import React from 'react';

const TableBody = props => {
    return (
        <>

            <tr>
                <th scope="row">{props.num}</th>
                <td>{props.recipe.title}</td>
                <td>{props.recipe.ingrediants}</td>
                <td>{props.recipe.instructions}</td>
                

            </tr>

        </>
    )
}

export default TableBody;
